import CardProjeto from './CardProjetos';
export default function Projects() {
  return (
    <section
      className="container center margin-container projetos"
      style={{ backgroundColor: '#ebebeb' }}
    >
      <h1 className="title">Conhe√ßa</h1>
      <h2 className="subtitle">Alguns dos meus projetos</h2>
      <div className="container-projetos">
        <div className="projeto">
          <div className="information">
            <h2>{props.title}</h2>
            <p>{props.paragraph}</p>
            <img src={props.tec1} alt={props.alt1} />
            <img src={props.tec2} alt={props.alt2} />
            <img src={props.tec3} alt={props.alt3} />
            <img src={props.tec4} alt={props.alt4} />
          </div>
          <img src={null} alt="" className="project-img" />
        </div>
      </div>
    </section>
  );
}
